import Message from './message_help'

export default {
    state: {
        users: [{
            id: 1,
            name: 'Иван Иванов',
            avatar: 'data:image/jpeg;base64,',
            current: false
        }],
        arrayMessages: [],
        messages: []
    },
    actions: {
        async newMessage({commit}, payload) {
            try {
                const newMessage = new Message(
                    payload.userId,
                    payload.to,
                    payload.text
                )
                commit('newMessage', {
                    ...newMessage
                })
            } catch (error) {
                console.log(error.message)
                throw error
            }
        },
        async filterMessages({commit}, payload) {
            try {
                let newMessage = []
                payload.forEach(message => {
                    newMessage.push({
                        userId: message.userId,
                        to: message.to,
                        text: message.text
                    })
                })
                commit('filterMessages', newMessage)
            } catch (error) {
                console.log(error.message)
                throw error
            }
        },
        async userChange({commit}) {
            try {
                commit('userChange')
            } catch (error) {
                console.log(error.message)
                throw error
            }
        },
        async createUser({commit}, payload) {
            try {
                commit('createUser', payload)
            } catch (error) {
                console.log(error.message)
                throw error
            }
        },
        async logoutUser({commit}) {
            try {
                commit('logoutUser')
            } catch (error) {
                console.log(error.message)
                throw error
            }
        }
    },
    mutations: {
        newMessage(state, payload) {
            state.arrayMessages.push(payload)
        },
        filterMessages(state, payload) {
            state.messages = []
            payload.forEach(message => {
                state.messages.push(message)
            })
        },
        userChange(state) {
            state.users.forEach(user => {
                user.current = !user.current
            })
        },
        createUser(state, payload) {
            state.users.push(payload)
        },
        logoutUser(state) {
            state.users.pop()
        }
    },
    getters: {
        getUsers (state) {
            return state.users
        },
        getMessages (state) {
            return state.messages
        },
        getAllMessages (state) {
            return state.arrayMessages
        },
        getCurrentUser (state) {
            let currentIndex = state.users.findIndex(item => {
                return item.current
            })
            return state.users[currentIndex]
        }
    }
}
